@-moz-document domain("keepass.info") {
/* 15 outer background 33 inner background*/
html,
body {
   background-color: rgb(15,15,15);
   color: rgb(150,150,150);
   background-image: none;
}
p {color: rgb(150,150,150);}
hr {border-color: rgb(77,77,77); border-width: 3px;}
small, large {color: rgb(150,150,150);}
li {color: rgb(150,150,150);}
table {color: rgb(125,125,125);}
body, p, div, ol, ul, li, td, th, dd, dt, tr, td {
   background-color: rgb(25,25,25);
   color: rgb(150,150,150);
   padding: 6px;
   margin: 6px;
}
html > body > table > tbody > tr > tbody,
html > body > table > tbody > tr > tr,
html > body > table > tbody > tr > td {
   background-color: rgb(25,25,25);
   padding: 6px; 
   margin: 6px;
}
html > body > table > tbody > tr > td:nth-child(2) {
   background-color: rgb(33,33,33);
   padding: 6px;
   margin: 6px;
}

a {color: rgb(120,120,200);}
a:link {color: rgb(120,120,200);}
a:hover {color: rgb(170,170,225);}
a:active {color: rgb(200,200,225);}
a:visited {color: rgb(120,120,170);}
h1, h2, h3, h4, h5, h6 {color: rgb(130,130,170);}

::-moz-selection { /* Code for Firefox */
    color: rgb(150,150,150);
    background: rgb(149,149,149);
}
::selection { /* chrome and others */
    color: rgb(150,150,150);
    background: rgb(50,50,70);
}


h1.sectiontitle, h2.sectiontitle, h3.sectiontitle, h4.sectiontitle, h5.sectiontitle {border: 1px solid #000;}
div.menubox {
   background-color: rgb(50,50,50);
   color: rgb(150,150,150);
   border: none;
}
